import React from 'react'
import Header from './Components/Header';
import Movie from './Components/Movie';
import movie from './movie.json'
import "./App.css";

const App = () => {
  return (
    <div className='App'>
    <Header />
    <div className='main'>
    {
      movie.map((element) =>{
        <Movie title = {element.title} year = {element.year}
        img= {element.Poster}/>
      })
    }

    </div>
    </div>
  )
}

export default App
